import { Helmet } from "react-helmet";
import Navbar from "../Navbar";
import Side from "../Side";
import Sidebar from "../Sidebar";
import Channel from "./Channel";
import { NavLink, useNavigate, useParams } from "react-router-dom";
import author from '../../assets/author.png';
import { useEffect, useState } from "react";

export default function ChannelChannels({ userInfo }){
    const navigate = useNavigate();
    const [userinfo, setuserinfo] = useState([]);
    const [isLoading, setIsLoading] = useState(true);
    const [subsdata, setsubsdata] = useState([]);
    const { channelslug } = useParams();
    const channelslu = channelslug.replace('@', '');

    useEffect(() => {
        fetch(`http://localhost:8000/api/user_channel_json/${channelslu}`, {
            method: 'GET',
            credentials: 'include',
        })
        .then(response => {
            if (response.status === 200) {
                return response.json();
            } else {
                navigate('/');
                throw new Error('Failed to fetch user info');
            }
        })
        .then(data => {
            setuserinfo(data);
            setIsLoading(false);
            console.log(data);
            setsubsdata(data.subscriber_data);
        })
        .catch(error => {
            console.error('Error fetching user info:', error);
        });
    }, [])

    return (
        <>
            <Helmet>
                {userinfo.name ? (
                    <title>{`${userinfo.name} - YouTube`}</title>
                ):(
                    <title>YouTube</title>
                )}
            </Helmet>
            <Navbar userInfo={userInfo} />
            <div className="main">
                <Side />
                <Sidebar subdata={subsdata} />
                <div className="main-scroll">
                    <div className="channellayer">
                        <Channel channelslug={channelslu} userinfo={userinfo} />
                        <div className="channelvideoscon">
                            <h4>Channels</h4>
                            <div className="channelvideoscon-inner">
                                {subsdata.length <= 5 ? (
                                    <>
                                        {subsdata.map((sub) => (
                                            <div className="channelvid" key={sub.id}>
                                                <div className="channelvid-img">
                                                    <div className="channel-img">
                                                        <NavLink to={`/@${sub.slug}`}>
                                                            <img alt={sub.id} src={sub.image ? sub.image : author} />
                                                        </NavLink>
                                                    </div>
                                                </div>
                                                <div className="channelvid-detail">
                                                    <div className="channelvid-detail-inner">
                                                        <h3>{sub.name}</h3>
                                                        <label>{sub.subs} Subscribers</label>
                                                    </div>
                                                </div>
                                            </div>
                                        ))}
                                        <div className="channelvid"></div>
                                        <div className="channelvid"></div>
                                        <div className="channelvid"></div>
                                        <div className="channelvid"></div>
                                        <div className="channelvid"></div>
                                        <div className="channelvid"></div>
                                    </>
                                ):(
                                    <>
                                        {subsdata.map((sub) => (
                                            <div className="channelvid" key={sub.id}>
                                                <div className="channelvid-img">
                                                    <div className="channel-img">
                                                        <NavLink to={`/@${sub.slug}`}>
                                                            <img alt={sub.id} src={sub.image ? sub.image : author} />
                                                        </NavLink>
                                                    </div>
                                                </div>
                                                <div className="channelvid-detail">
                                                    <div className="channelvid-detail-inner">
                                                        <h3>{sub.name}</h3>
                                                        <label>{subsdata.length} Subscribers</label>
                                                    </div>
                                                </div>
                                            </div>
                                        ))}
                                    </>
                                )}
                            </div>
                        </div>
                    </div>
                </div>
            </div>
        </>
    )
}
